/*Table structure for table `users` */

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `userid` char(20) NOT NULL,
  `valid` char(1) NOT NULL DEFAULT '1',
  `role` int(32) NOT NULL,
  `lastlogintime` datetime DEFAULT NULL,
  `email` char(50) DEFAULT NULL,
  `phone` char(30) DEFAULT NULL,
  `receive_email` char(1) NOT NULL DEFAULT '1',
  `receive_sms` char(1) NOT NULL DEFAULT '1',
  `avatar` varchar(400) DEFAULT NULL,
  `username` varchar(400) DEFAULT NULL,
  `receive_wx` char(1) NOT NULL DEFAULT '0',
