  `receive_app_alert` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '接受告警推送（合用电APP）',
  `receive_app_warning` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '接受提醒推送（合用电APP）',
  `clientId` varchar(64) NOT NULL DEFAULT '' COMMENT 'app设备唯一id字符串',
  PRIMARY KEY (`id`),
  KEY `users_role_fkey` (`role`) USING BTREE,
  CONSTRAINT `users_ibfk_1` FOREIGN KEY (`role`) REFERENCES `role` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=514 DEFAULT CHARSET=utf8;

